import './Main.css';
import woman1 from '../../assets/img/Items/womenFirst.jpg';


const Main = () => {
    return (
        <div className='Main'>
            <main>
                <section>
                    <img src={woman1} alt='woman_clothes'/>
                </section>
            </main>
        </div>
    )
}

export default Main;
